import React, { useState } from "react";

function Cart() {
  const [cartItems, setCartItems] = useState([]);

  return (
    <div>
      <h2>Cart</h2>
      {cartItems.length === 0 && <p>Cart is empty</p>}
      {cartItems.map((item) => (
        <div key={item.id}>
          <p>{item.title}</p>
          <p>{item.price}</p>
        </div>
      ))}
    </div>
  );
}

export default Cart;
